import photo from "../assets/photo.png";
import "./css/main.css";

const Main = () => {
  return (
    <main>
      <div className="text">
        <h1>Emoção, diversão, Parque Umbara.</h1>
        <h2>O destino perfeito para o seu próximo passeio!</h2>
      </div>
      <div className="img"><img src={photo} alt="" /></div>
    </main>
  );
};

export default Main;
